import React, { useEffect, useRef } from 'react';
import * as THREE from 'three';
import { GLTFLoader } from 'three/examples/jsm/loaders/GLTFLoader';
import { OrbitControls } from 'three/examples/jsm/controls/OrbitControls';

const LandingPage = () => {
  const canvasRef = useRef(null);

  useEffect(() => {
    // 1. Scene setup
    const scene = new THREE.Scene();
    const camera = new THREE.PerspectiveCamera(25, window.innerWidth / window.innerHeight, 0.1, 1000);
    const renderer = new THREE.WebGLRenderer({ canvas: canvasRef.current, antialias: true });

    // Set the renderer size and background color to white
    renderer.setSize(window.innerWidth, window.innerHeight);
    renderer.setClearColor(0xffffff, 1); // Background color

    // Append the canvas to the body
    document.body.appendChild(renderer.domElement);

    // 2. Lighting
    const light = new THREE.AmbientLight(0xffffff, 1.5); // Ambient light
    scene.add(light);

    const directionalLight = new THREE.DirectionalLight(0xffffff, 1);
    directionalLight.position.set(5, 5, 5).normalize();
    scene.add(directionalLight);

    // 3. Load Video Texture for Background
    const video = document.createElement('video');
    video.src = '/assets/intro.mp4'; // Path to your video file
    video.loop = true;
    video.muted = true; // Mute video
    video.load(); // Load video

    const startVideo = () => {
      video.play().catch((error) => {
        console.error('Error attempting to play video:', error);
      });
      window.removeEventListener('click', startVideo); // Remove event listener
    };

    window.addEventListener('click', startVideo);

    const videoTexture = new THREE.VideoTexture(video);
    videoTexture.minFilter = THREE.LinearFilter; // Smooth rendering
    videoTexture.magFilter = THREE.LinearFilter;

    const geometry = new THREE.PlaneGeometry(2, 2); // Plane for video
    const material = new THREE.MeshBasicMaterial({ map: videoTexture, side: THREE.DoubleSide });
    const plane = new THREE.Mesh(geometry, material);
    plane.scale.set(window.innerWidth / window.innerHeight, 1, 1);
    plane.position.z = -1;
    scene.add(plane);

    // 4. Load GLTF Model
    const loader = new GLTFLoader();
    let propeller = null;

    loader.load('./a.glb', (gltf) => {
      propeller = gltf.scene;
      scene.add(propeller);

      propeller.scale.set(10, 10, 10);
      propeller.position.set(15, 0, 0);
      propeller.rotation.x = Math.PI / 2;

      console.log("Model loaded successfully!");
    }, undefined, (error) => {
      console.error("Error loading GLTF model:", error);
    });

    // 5. Add OrbitControls
    const controls = new OrbitControls(camera, renderer.domElement);
    controls.enableDamping = true;
    controls.dampingFactor = 0.25;
    controls.screenSpacePanning = false;
    controls.maxPolarAngle = Math.PI / 2;

    // Mouse movement tracking
    const mouse = new THREE.Vector2();
    const onMouseMove = (event) => {
      mouse.x = (event.clientX / window.innerWidth) * 2 - 1;
      mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;

      if (propeller) {
        propeller.rotation.x = Math.PI / 2 + mouse.y * Math.PI / 6;
        propeller.rotation.y = mouse.x * Math.PI / 3;
      }
    };

    window.addEventListener('mousemove', onMouseMove);

    // Animation loop
    const animate = () => {
      requestAnimationFrame(animate);

      if (propeller) {
        propeller.rotation.y += 0.05;
      }

      const zoomFactor = 10 + window.scrollY / window.innerHeight * 20;
      camera.position.z = zoomFactor;

      if (propeller) {
        propeller.position.x = window.scrollY / window.innerHeight * 5;
        propeller.position.y = -(window.scrollY / window.innerHeight) * 1;
      }

      controls.update();
      renderer.render(scene, camera);
    };

    animate();

    camera.position.z = 100;

    return () => {
      window.removeEventListener('mousemove', onMouseMove);
      window.removeEventListener('click', startVideo);
    };
  }, []);

  return (
    <>
      <canvas ref={canvasRef} />
      {/* Navbar */}
      <nav
        style={{
          position: 'absolute',
          top: 0,
          left: 0,
          right: 0,
          background: 'transparent',
          zIndex: 10,
          padding: '10px',
        }}
      >
        <h1 style={{ color: 'white' }}>Your Navbar</h1>
      </nav>

      {/* Extended space for components */}
      <div
        style={{
          height: '500vh', // 5 times the viewport height
          position: 'relative',
          zIndex: 1, // Below the canvas
        }}
      >
        {/* Add your components here */}
        <section style={{ height: '100vh', background: 'rgba(0,0,0,0.5)', color: 'white' }}>
          <h2 style={{ textAlign: 'center', paddingTop: '50vh' }}>Add Components Below</h2>
        </section>
      </div>
    </>
  );
};

export default LandingPage;
